/**
 * @brief
 * reset srnn sqm info
 */
void SrnnLib_SrnnSQMInfo_Reset(void){
	gSrnnSQMInfo.RawRes = VIP_SRNN_TIMING_MAX;
	gSrnnSQMInfo.CurRes = VIP_SRNN_TIMING_MAX;
	gSrnnSQMInfo.TgtRes = VIP_SRNN_TIMING_MAX;
	gSrnnSQMInfo.Direction = SRNN_SQM_DIRECTION_KEEP;
	gSrnnSQMInfo.DirectionCounter = 0;
	gSrnnSQMInfo.Status = SRNN_SQM_STATUS_UNKNOWN;
}

/**
 * @brief
 * srnn sqm info init
 */
void SrnnLib_SrnnSQMInfo_Init(VIP_SRNN_SOURCE_TIMING src_timing){
	switch(src_timing){
		case VIP_SRNN_60HZ_2X_720:
			// normal 2k60
			gSrnnSQMInfo.RawRes = VIP_SRNN_SQM_2K_2KGOOD;
			gSrnnSQMInfo.CurRes = VIP_SRNN_SQM_2K_2KGOOD;
			gSrnnSQMInfo.TgtRes = VIP_SRNN_SQM_2K_2KGOOD;
			gSrnnSQMInfo.Direction = SRNN_SQM_DIRECTION_KEEP;
			gSrnnSQMInfo.DirectionCounter = 0;
			gSrnnSQMInfo.WeightAlpha = 0;
			gSrnnTableInfo.TimingIdx = gSrnnSQMInfo.CurRes;
			gSrnnSQMInfo.Status = SRNN_SQM_STATUS_READY;
			break;
		case VIP_SRNN_60HZ_2X_PREDOWN:
			// 4kin predown
			gSrnnSQMInfo.RawRes = VIP_SRNN_SQM_4K_4K;
			gSrnnSQMInfo.CurRes = VIP_SRNN_SQM_4K_4K;
			gSrnnSQMInfo.TgtRes = VIP_SRNN_SQM_4K_4K;
			gSrnnSQMInfo.Direction = SRNN_SQM_DIRECTION_KEEP;
			gSrnnSQMInfo.DirectionCounter = 0;
			gSrnnSQMInfo.WeightAlpha = 0;
			gSrnnTableInfo.TimingIdx = gSrnnSQMInfo.CurRes;
			gSrnnSQMInfo.Status = SRNN_SQM_STATUS_READY;
			break;
		default:
			gSrnnSQMInfo.Status = SRNN_SQM_STATUS_UNKNOWN;
			rtd_pr_vpq_emerg("[%s] Unsupport src_timing = %d  \n", __FUNCTION__,  src_timing);
			break;
	}

}

/**
 * @brief
 * get direction status by given two timing
 */
unsigned char SrnnLib_SrnnSQMInfo_GetDirection(VIP_SRNN_SOURCE_TIMING src_timing, VIP_SRNN_SOURCE_TIMING tgt_timing){
	if (src_timing == tgt_timing){
		return SRNN_SQM_DIRECTION_KEEP;
	}
	else if (src_timing < tgt_timing){
		return SRNN_SQM_DIRECTION_DOWN;
	}
	else{
		return SRNN_SQM_DIRECTION_UP;
	}
}

/**
 * @brief
 * get next srnn timing idx by sqm direction
 */
unsigned char SrnnLib_SrnnSQMInfo_GetNextSQMTiming(VIP_SRNN_SOURCE_TIMING src_timing, unsigned char sqm_direction){
	unsigned char ret = src_timing;

	switch(sqm_direction){
		case SRNN_SQM_DIRECTION_UP:
			if (src_timing != VIP_SRNN_SQM_4K_4K && src_timing != VIP_SRNN_SQM_2K_2KGOOD){	// boundary
				ret = (src_timing -1);
			}
			return ret;
			break;
		case SRNN_SQM_DIRECTION_DOWN:
			if (src_timing != VIP_SRNN_SQM_4K_480 && src_timing != VIP_SRNN_SQM_2K_480){	// boundary
				ret = (src_timing + 1);
			}
			return ret;
			break;
		case SRNN_SQM_DIRECTION_KEEP:
			return ret;
			break;
		default:
			rtd_pr_vpq_emerg("[%s] Not SQM Timing  =%d \n", __FUNCTION__, src_timing);
			return ret;
			break;
	}
}

